import { useEffect, useState } from "react";
import "./App.css";

function Users() {
  const [user, setUser] = useState([]);
  useEffect(() => {
    fetch("http://localhost:8081/users")
      .then((res) => res.json())
      .then((json) => {
        this.setState({
          items: json,
          DataisLoaded: true,
        });
      });
  }, []);
  return <div className="Users"></div>;
}

export default Users;
